//Smooth Scrolling for Anchor Navigation
$("a[href^='#']").click(function(e) {
    e.preventDefault();

    var position = $($(this).attr("href")).offset().top;

    $("body, html").animate({
        scrollTop: position
    } /* speed */ );
});

//Disable navbar until scroll
(function ($) {
    $(document).ready(function(){

        // hide .navbar first
        $(".navbar").hide();

        // fade in .navbar
        $(function () {
            $(window).scroll(function () {

                // set distance user needs to scroll before we start fadeIn
                if ($(this).scrollTop() > 100) {
                    $('.navbar').fadeIn(200);
                } else {
                    $('.navbar').fadeOut(200);
                }
            });
        });

    });
}(jQuery));

//Validate contact form then submit it
function validateForm() {
    document.getElementById('status').innerHTML = "Sending...";

    formData = {
        'name'     : $('input[name=name]').val(),
        'email'    : $('input[name=email]').val(),
        'subject'  : $('input[name=subject]').val(),
        'message'  : $('textarea[name=message]').val(),
        'captcha'  : $('input[name=captcha]').val(),
        'captchaValue'  : captchaFirstInt + captchaSecondInt
    };


    //Ajax for contact form so the page doesn't need to reload
    $.ajax({
        url : "php/mail.php",
        type: "POST",
        data : formData,
        success: function(data, textStatus, jqXHR)
        {

            $('#status').text(data.message);
            if (data.code) //If mail was sent successfully, reset the form.
                $('#contact-form').closest('form').find("input[type=text], textarea").val("");
        },
        error: function (jqXHR, textStatus, errorThrown)
        {
            // $('#status').html(jqXHR.responseText);
            $('#status').html("<b>ERROR:</b><p>Please make sure all fields are entered correctly. If they are please use the email listed on the right and inform me.</p>");
        }
    });
}